    false,nt"url": null,nt"notes": "The 2002-2005 Farallon National Wildlife
    Refuge Annual Narrative Reports. The Farallon National Wildlife Refuge was established
    in 1909 and is located approximately 28 miles west of San Francisco. It is comprised
    of four groups of Islands including the North Farallons, Middle Farallons, and Noonday
    Rock which are all designated as wilderness areas. The South Farallon Islands were
    given refuge status in 1969 and is the largest The Annual Narrative Report is a
    discussion of the refuge condition over the course of the year. Wildlife, including
    migratory birds, raptors and other mammals as well as disease status are touched
    on. In addition, an overview of developments and maintenance that have taken place
    on the refuge is given. A summary of any research that has taken place is presented
    as well as resource management strategies and public relations approaches. Management
    strategies, including fire management, pest control, habitat management, and wildlife
    management are also included in the annual narrative.",nt"license_title": "License
